export enum TaskType {
    CODING = "coding",
    TESTING = "testing",
    DOCUMENTATION = "documentation",
    REVIEW = "review"
}

export enum TaskStatus {
    PENDING = "pending",
    IN_PROGRESS = "in_progress",
    COMPLETED = "completed"
}

export interface Task {
    id: string;
    type: TaskType;
    description: string;
    status: TaskStatus;
    assigned_to: string | null;
    batch_number: number;
}

export interface Player {
    id: string;
    name: string;
    current_tasks: Task[];
    completed_tasks: Task[];
}

export interface Game {
    id: string;
    players: Player[];
    current_batch: number;
    max_batches: number;
    tasks: Task[];
    status: string;
}
